from satisfacao_restricoes import Restricao, SatisfacaoRestricoes

class TurnosDiferentes(Restricao):
  def __init__(self, turno1, turno2):
    super().__init__([turno1, turno2])
    self.turno1 = turno1
    self.turno2 = turno2

  def esta_satisfeita(self, atribuicao):
    if self.turno1 in atribuicao and self.turno2 in atribuicao:
      return atribuicao[self.turno1] != atribuicao[self.turno2]
    return True  

class Turno():
  def __init__(self, time1, time2):
    self.time1 = time1.nome
    self.time2 = time2.nome
    self.cidade = time1.cidade

  def ImprimeTurno(self):
    turno = self.time1 + " x " + self.time2 + " | Cidade: " + self.cidade
    return turno

class Time():
  def __init__(self, nome, cidade, torcida):
    self.nome = nome
    self.cidade = cidade
    self.torcida = torcida
    
